import { useState, useEffect } from 'react';

import './App.css';

function App() {
  const [articles, setArticles] = useState([]);

  useEffect(() => {
    fetch('http://127.0.0.1:5000/get', {
    'methods': 'GET'
    })
  })

  return (
    <div className="App">
      <h1>Flask and React Teste</h1>
    </div>
  );
}

export default App;
